Inspector Gadget (1999)  

Actie / Komedie
78 minuten

geregisseerd door David Kellogg
met Matthew Broderick, Rupert Everett en Michelle Trachtenberg

De bewaker John Brown wil niets liever dan een echte agent zijn. Nadat een gevecht met een dief hem in kritieke toestand heeft gebracht, wordt hij door zijn werkgeefster veranderd in de robot-achtige superagent Inspector Gadget. Samen met een nieuwe geliefde gaat hij achter de slechterik Claw aan.
